import React from "react";

const InfoTooltip = ({isClose}) =>{
    return(
        <div className='popup popup_open'>
            <div className="popup__content">
                <button type="button" className="popup__close" onClick={isClose}></button>
                <img src="../images/Yes.svg" alt="yes"/>
                <h3 className="popup__title">Вы успешно зарегистрировались!</h3>
            </div>
        </div>
    )
}

export default InfoTooltip
